import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { LogService } from '@services/log-service.service';

@Component({
  selector: 'app-menu-activos-fijos',
  templateUrl: './menu-activos-fijos.component.html',
  styleUrls: ['./menu-activos-fijos.component.scss']
})
export class MenuActivosFijosComponent implements OnInit {

  constructor(public router:Router,public log_module:LogService) { }
 
  ngOnInit() {
  }

  guardarRutaLOG(nombre, ruta){
    this.log_module.guardarVentana(nombre,ruta);
    this.router.navigate([ruta]);
  }
}
<a mat-button class="nav-link" [matMenuTriggerFor]="mantenimiento" matTooltip="Activos Fijos">
  <span><i class="fa fa-cubes" aria-hidden="true" style="font-size: 1.4rem !important;color: #093070;"></i>
  <mat-icon style="padding-block-start: 7px;color: #093070;">keyboard_arrow_down</mat-icon></span>
</a>

<mat-menu #mantenimiento="matMenu">
  <a mat-menu-item >Administración de Activos </a>
  <a mat-menu-item >Mantenimiento Activo</a>
  <a mat-menu-item >Revaluo de Activos</a>
  <a mat-menu-item >Depreciación de Activos</a>
  <a mat-menu-item >Depreciación de Activos Por Periodos</a>
  <a mat-menu-item >Traslado de Activos</a>
  <a mat-menu-item >Baja de Activos</a> 
</mat-menu>
